import Data from './Data'
import Header from './components/Header'
import Footer from './components/Footer'
import Card from './components/Card'
import './App.css';

function App() {
  var nome = Data.id
  return (
    <div className="App">
      <Header atual="Home Page"/>
      <main>
          <Card nome_site={Data[0].id} desc_site={Data[0].body_text} link_site={Data[0].a_link} link_img={Data[0].url_img}/>


          <ul>
            {Data.map(data =>{
              <Card nome_site={data.id} desc_site={data.body_text} link_site={data.a_link} link_img={Data[0].url_img}/>
            })}
          </ul>

      </main>
      <Footer/>
    </div>
  );
}

export default App;
